import React, { useState ,useEffect} from 'react'
import ContentImage from "../assets/contentImage.webp";
import Iphone15 from "../assets/iphone15.jpg";
import "../styles/home.css"
export default function Home(props) {
  const [data, setData]=useState([]);

      useEffect( ()=>{  
        fetch("menus2.json",{
        headers: {
          'Content-Type':'application/json',
          'Accept':'application/json'

        }
        
      }).then((res)=>res.json())
      .then((myJson)=>{
        console.log(myJson)
        setData(myJson)
      })
      },[])
  
  return (
    
    <div className='container'>
     {data.map((item,index)=>{
        return(
        <div className='row' id='imageContainer'>
        {/* <h1 style={{textAlign:"center"}}>{props.Children}</h1> */}
        <div key={index} className='' >
       <img src={item.imgs} alt='listItem' className='w-50 rounded'/>
        </div>
        <div>
        <button className='btn btn-warning'>ORDER NOW</button>
        </div>
        </div>
        )
      })
     }
    </div>
  )
};
